def walk(n):
    prime=[i for i in range(n+1)]
    prime[0],prime[1] = -1, -1
    for i in range(2, n + 1):
        if prime[i] == i:
            for j in range(i * i, n + 1, i):
                prime[j] = i
    return prime
eos=walk(100000)
from library_for_lc import *
class Solution:
    @timeit
    def maximumScore(self, nums, k):
        st, ps, l, n, mod =[-1]*8, [], [], len(nums) , 1000000007
        for i,v in enumerate(nums):
            t, s = v, set()
            while t != 1:
                s.add(eos[t])
                t = t//eos[t]
            sc = len(s)
            ps.append(sc)
            msc = max(st[sc:])
            l.append(i-msc)
            st[sc] = i
        r, st, ans, res = [0]*n, [n]*8, [1]*n, 1
        for i in range(n-1,-1,-1):
            msc = min(st[ps[i]+1:])
            r = msc - i
            ans[i] = l[i] * r
            st[ps[i]] = i
        nums1 = sorted(enumerate(nums), key=lambda x:-x[1])
        print('sum', sum(ans))
        cnt = 0
        for i, x in nums1:
            nk = k - ans[i]
            if nk <= 0: 
                res *= (x**k) % mod
                break
            else: res = res*pow(x, ans[i], mod) % mod
            k, cnt = nk, cnt+1
            #print((i,x), 'k', k, 'res', res)
        print("Total cnt ", cnt, res) 
        return res % mod

